INSERT INTO `courseinformation` VALUES ('41', '计算机系', 'XX110100', '编译原理', '课程目标1：能阐述和解释文法与语言、正规文法、正规表达式、自动机、上下文无关文法，LL(1)文法、LR(0)、 SLR(1)、LR(1)、LALR(1)、语法制导的语义计算、属性文法中的关键概念，能列举出这些关键概念的典型例子, 并能判断关于这些关键概念的基本命题的正确性。（支撑毕业要求1.1中“掌握表述计算机工程问题所需的数学、自然科学和工程基础理论”）；\n课程目标2：能描述词法分析所需的正规表达式的构造规则，并能设计基本词法规则的正规式。能使用自动机的相互转换方法将不同类型的自动机转换为对应的等价形式', '课程目标1：可以清晰完整明确的阐述编译理论中的关键概念，并能列举出这些关键概念的典型例子, 并能正确判断关于这些关键概念的复杂命题的是否正确。\n课程目标2：能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 该结果完全正确或有极少量的错误。\n课程目标3：能语义计算问题表达为属性文法的设计问题,并设计属性文法中的语义动作,并计算语义;能翻译基本控制结构为中间代码, 要求属性文法设计、语义计算结果完全正确或有极少量的错误', '课程目标1：可以完整阐述编译理论中的关键概念，并能列举出这些关键概念的典型例子, 并能正确判断关于这些关键概念的较为复杂命题的是否正确。课程目标2：能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 该结果与正确结果相比有少量的错误\n课程目标2：能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 该结果与正确结果相比有少量的错误\n课程目标3：能语义计算问题表达为属性文法的设计问题,并设计属性文法中的语义动作,并计算语义;能翻译基本控制结构为中间代码, 要求要求属性文法设计、语义计算', '  课程目标1：可以完整阐述编译理论中的关键概念，并能列举出这些关键概念的典型例子, 并能正确判断关于这些关键概念的基本命题的是否正确。课程目标2：能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 该结果与正确结果相比有一些的错误\n课程目标3：能语义计算问题表达为属性文法的设计问题,并设计属性文法中的语义动作,并计算语义;能翻译基本控制结构为中间代码, 要求要求属性文设计法、语义计算、结果与正确结果相比有一些的错误', '课程目标1：可以较为完整的阐述编译理论中的关键概念，并能列举出这些关键概念的典型例子, 并能正确判断关于这些关键概念的基本命题的是否正确。\n课程目标2：能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 该结果与正确结果大部分相符\n课程目标3：能语义计算问题表达为属性文法的设计问题,并设计属性文法中的语义动作,并计算语义;能翻译基本控制结构为中间代码, 要求属性文法设计、语义计算结果与正确结果大部分相符', '课程目标1：不能阐述编译理论中的关键概念，不能列举出这些关键概念的典型例子, 不能正确判断关于这些关键概念的基本命题的是否正确。\n课程目标2：不能使用课程目标2中要求掌握的方法对给定的问题进行求解得出结果, 或求解出的结果与正确结果相差很大\n课程目标3：定某个基础的语义计算问题,设计出属性文法与正确结果相差很大或完全错误;语义计算结果与正确结果相相差很大或完全错误');
INSERT INTO `courseinformation` VALUES ('42', '计算机系', 'XX120180', '计算方法', '课程目标1：标点1.2：掌握计算机程序设计所需的数学表达方式、计算方法、数据结构。课程目标2：指标点4.3：能够分析系统运行所需的时空成本；能分析和解释实验结果对应的物理意义，理解系统的使用对象、适用范围，综合得到合理有效的结论。课程目标3：指标点5.3：能对复杂计算机系统的运行进行测试和模拟，能分析系统、算法和工具的局限性。', '课程目标1：能准确描述非线性方程求解，线性方程组求解，插值，最小二乘法，三角插值和FFT问课程目标2：能准确运用所需数学知识，准确分析和计算算法的复杂度，准确分析算法的收敛性条件。\n课程目标3：熟练使用MATLAB实现所有模拟实验，代码简练，运行高效正确。', '课程目标1：能合理描述非线性方程求解，线性方程组求解，插值，最小二乘法，三角插值和FFT问题的计算机数值方法。\n课程目标2：能合理运用所需数学知识，合理分析和计算算法的复杂度，合理分析算法的收敛性条件。课程目标3能较好地使用MATLAB实现所有模拟实验，代码运行高效正确。', '课程目标1能描述非线性方程求解，线性方程组求解，插值，最小二乘法，三角插值和FFT问题的计算机数值方法。\n课程目标2：能运用所需数学知识，可分析和计算算法的复杂度，可分析算法的收敛性条件。课程目标3：能使用MATLAB实现所有模拟实验，程序运行正确。', '课程目标1：能基本描述非线性方程求解，线性方程组求解，插值，最小二乘法，三角插值和FFT问题的计算机数值方法。课程目标2：能基本运用所需数学知识，基本正确地分析和计算算法的复杂度，基本正确地分析算法的收敛性条件。课程目标3：能使用MATLAB实现大部分模拟实验，程序可运行。', '课程目标1：无法描述非线性方程求解，线性方程组求解，插值，最小二乘法，三角插值和FFT问题的计算机数值方法。\n课程目标2：数学基础欠缺，无法分析和计算算法的复杂度，无法分析算法的收敛性条件。课程目标3：使用MATLAB不熟练，程序运行较多错误。');
